import React, { useState, useEffect } from "react";
import "../style/SoundPage.css";

export default function MusicInsights() {
  // Original states
  const [danceabilityRows, setDanceabilityRows] = useState([]);
  const [energyRows, setEnergyRows] = useState([]);
  const [filteredEnergyRows, setFilteredEnergyRows] = useState([]);
  const [genres, setGenres] = useState([]);
  const [selectedGenre, setSelectedGenre] = useState("All");
  const [topN, setTopN] = useState(5);
  const [audioProfilesRows, setAudioProfilesRows] = useState([]);
  const [moodRows, setMoodRows] = useState([]);
  const [filteredMoodRows, setFilteredMoodRows] = useState([]);
  const [error, setError] = useState("");
  const [selectedMood, setSelectedMood] = useState("All");
  const [rowsPerPage, setRowsPerPage] = useState(5);
  const [currentPage, setCurrentPage] = useState(1);

  // New feature states
  const [instrumentalness, setInstrumentalness] = useState(0);
  const [energy, setEnergy] = useState(0);
  const [valence, setValence] = useState(0);
  const [liveness, setLiveness] = useState(0);
  const [acousticness, setAcousticness] = useState(0);
  const [songs, setSongs] = useState([]);
  const [loading, setLoading] = useState(false);

  // Fetch Functions
  useEffect(() => {
    fetchDanceabilityData();
    fetchEnergyData();
    fetchAudioProfilesData();
    fetchSongsByMood();
  }, []);

  const fetchDanceabilityData = async () => {
    try {
      const response = await fetch("http://localhost:8080/tracks/above-average-danceability");
      if (!response.ok) throw new Error(`Failed to fetch data`);
      const data = await response.json();
      setDanceabilityRows(data.rows.sort(() => 0.5 - Math.random()).slice(0, 5));
    } catch (err) {
      setError("Failed to load danceability data.");
    }
  };

  const fetchEnergyData = async () => {
    try {
      const response = await fetch("http://localhost:8080/tracks/rank-by-energy");
      const data = await response.json();
      setEnergyRows(data.rows || []);
      setFilteredEnergyRows(applyFilters(data.rows || [], selectedGenre, topN));
      setGenres(["All", ...new Set(data.rows.map((row) => row.genre_name))]);
    } catch {
      setError("Failed to load energy data.");
    }
  };

  const fetchAudioProfilesData = async () => {
    try {
      const response = await fetch("http://localhost:8080/audio-feature-profiles");
      const data = await response.json();
      setAudioProfilesRows(data.rows || []);
    } catch {
      setError("Failed to load audio profiles data.");
    }
  };

  const fetchSongsByMood = async () => {
    try {
      const response = await fetch("http://localhost:8080/songs/mood");
      const data = await response.json();
      setMoodRows(data || []);
      setFilteredMoodRows(data || []);
    } catch {
      setError("Failed to load songs by mood.");
    }
  };

  const fetchSongs = async () => {
    try {
      setLoading(true);
      const queryParams = new URLSearchParams({
        instrumentalness: instrumentalness > 0 ? instrumentalness : undefined,
        energy: energy > 0 ? energy : undefined,
        valence: valence > 0 ? valence : undefined,
        liveness: liveness > 0 ? liveness : undefined,
        acousticness: acousticness > 0 ? acousticness : undefined,
      });

      const response = await fetch(`http://localhost:8080/songs-by-audio-features?${queryParams}`);
      const data = await response.json();
      if (data.rows && data.rows.length > 0) setSongs(data.rows);
      else setError("No songs found matching the criteria.");
    } catch {
      setError("Failed to fetch songs. Please try again later.");
    } finally {
      setLoading(false);
    }
  };

  const clearFilters = () => {
    setInstrumentalness(0);
    setEnergy(0);
    setValence(0);
    setLiveness(0);
    setAcousticness(0);
    setSongs([]);
    setError("");
  };

  const applyFilters = (rows, genre, n) => {
    let filtered = rows;
    if (genre !== "All") filtered = rows.filter((row) => row.genre_name === genre);
    return filtered.sort((a, b) => b.energy - a.energy).slice(0, n);
  };

  return (
    <>
      {/* Navigation Bar */}
      <div id="sound-page-wrapper">
        <div id="navbar">
          <ul>
            <li><a href="http://localhost:3000/">HomePage</a></li>
            <li><a href="http://localhost:3000/search">Search Page</a></li>
            <li><a href="http://localhost:3000/genre">Genre Page</a></li>
            <li><a href="http://localhost:3000/collaboration">Collaboration</a></li>
          </ul>
        </div>

        <h1>Track Explorer</h1>
        {/* Left and Right Panels */}
        <div id="page-wrapper">
          <div id="content-wrapper">
            <div className="panel">
              <section className="table-section">
                <h2>Wanna Dance?</h2>
                <table className="data-table">
                  <thead>
                    <tr><th>Track Title</th><th>Genre</th><th>Danceability</th></tr>
                  </thead>
                  <tbody>
                    {danceabilityRows.map((row, index) => (
                      <tr key={index}><td>{row.title}</td><td>{row.genre_name}</td><td>{row.danceability}</td></tr>
                    ))}
                  </tbody>
                </table>
              </section>

              <section className="table-section">
                <h2>Hit The Gym!</h2>
                <table className="data-table">
                  <thead>
                    <tr><th>Rank</th><th>Track Title</th><th>Genre</th><th>Energy</th></tr>
                  </thead>
                  <tbody>
                    {filteredEnergyRows.map((row, index) => (
                      <tr key={index}><td>{index + 1}</td><td>{row.title}</td><td>{row.genre_name}</td><td>{row.energy}</td></tr>
                    ))}
                  </tbody>
                </table>
              </section>
            </div>

            <div className="panel">
              <section className="table-section">
                <h2>Top Audio Profiles by Genre</h2>
                <table className="data-table">
                  <thead>
                    <tr><th>Genre</th><th>Valence</th><th>Energy</th><th>Danceability</th><th>Profile Count</th></tr>
                  </thead>
                  <tbody>
                    {audioProfilesRows.map((row, index) => (
                      <tr key={index}><td>{row.genre_name}</td><td>{row.valence}</td><td>{row.energy}</td><td>{row.danceability}</td><td>{row.profile_count}</td></tr>
                    ))}
                  </tbody>
                </table>
              </section>

              {/* Filter Songs by Audio Features */}
              <section className="table-section" style={{ marginTop: "40px" }}>
                <h2>Filter Songs by Audio Features</h2>
                <div className="slider-container">
                  <label>Instrumentalness: {instrumentalness}</label>
                  <input type="range" min="0" max="1" step="0.01" value={instrumentalness} onChange={(e) => setInstrumentalness(parseFloat(e.target.value))} />
                  <label>Energy: {energy}</label>
                  <input type="range" min="0" max="1" step="0.01" value={energy} onChange={(e) => setEnergy(parseFloat(e.target.value))} />
                  <label>Valence: {valence}</label>
                  <input type="range" min="0" max="1" step="0.01" value={valence} onChange={(e) => setValence(parseFloat(e.target.value))} />
                </div>

                <div style={{ marginTop: "20px" }}>
                  <button onClick={fetchSongs}>Search Songs</button>
                  <button onClick={clearFilters} style={{ marginLeft: "10px" }}>Clear Filters</button>
                </div>

                {songs.length > 0 && (
                  <table>
                    <thead>
                      <tr><th>Title</th><th>Energy</th><th>Valence</th></tr>
                    </thead>
                    <tbody>
                      {songs.map((song, index) => (
                        <tr key={index}><td>{song.title}</td><td>{song.energy}</td><td>{song.valence}</td></tr>
                      ))}
                    </tbody>
                  </table>
                )}
              </section>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
